    data: |
      SELECT * FROM tab2 (FORMAT parquet) AS cor0 WHERE + 36 * + - col2 >= ( - - col1 * + - ( col1 ) * + 49 * + 66 );
  - name: tab2

outputs:
  - name: q12231.out
    data: |
      46	51	23
      64	77	40
      75	67	58
